import React, { Component } from "react";
import { Link } from "react-router-dom";

import { MenuStyle } from "../2_styles/3_module/MenuStyle";
import Line from "../0_components/Line";

export default class Menu extends Component {
  render() {
    return (
      <MenuStyle>
        <div id="menu_box">
          <div className="menu_items">
            <Link to="/the-initiative">
              <div className="menu_link initiative ">The Initiative</div>
            </Link>

            <div className="line menu_line">
              <Line opacity="0.3" width="90vw" />
            </div>

            <Link to="/the-original-six">
              <div className="menu_link original">The Original Six</div>
            </Link>

            <div className="line menu_line menu_line-delay">
              <Line opacity="0.3" width="90vw" />
            </div>

            <Link to="/the-become-an-avenger">
              <div className="menu_link become">Become An Avenger</div>
            </Link>
          </div>
        </div>
      </MenuStyle>
    );
  }
}
